export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},qETKUc7jwG:{data:{id:32,attributes:{imdbId:"tt2304933",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjQwOTc0Mzg3Nl5BMl5BanBnXkFtZTgwOTg3NjI2NzE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.2\u002F10"},{Source:"Rotten Tomatoes",Value:"16%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:695,attributes:{title:g,plot:"Four waves of increasingly deadly attacks have left most of Earth in ruin. Against a backdrop of fear and distrust, Cassie is on the run, desperately trying to save her younger brother. As she prepares for the inevitable and lethal fifth wave, Cassie teams up with a young man who may become her final hope - if she can only trust him.",slug:"the-5th-wave"}}},books:{data:[{id:1857,attributes:{title:"The 5th Wave Collection",description:"All three volumes in Yancey's award-winning, \"New York Times\"-bestselling series are collected in this box set: \"The 5th Wave, The Infinite Sea, \" and \"The Last Star.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NUNevgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2017-10-03",publisher:"Speak",subtitle:e}},{id:1858,attributes:{title:"The Last Star",description:"The highly-anticipated finale to the New York Times bestselling 5th Wave series. Includes an exclusive diary entry from Cassie! The enemy is Other. The enemy is us. They’re down here, they’re up there, they’re nowhere. They want the Earth, they want us to have it. They came to wipe us out, they came to save us. But beneath these riddles lies one truth: Cassie has been betrayed. So has Ringer. Zombie. Nugget. And all 7.5 billion people who used to live on our planet. Betrayed first by the Others, and now by ourselves. In these last days, Earth’s remaining survivors will need to decide what’s more important: saving themselves . . . or saving what makes us human. Praise for The Last Star “Yancey’s prose remains achingly precise, and this grows heavier, tighter, and more impossible to put down as the clock runs out…this blistering finale proves the truth of the first two volumes: it was never about the aliens.”—Booklist, starred review “A haunting, unforgettable finale.”—Kirkus Reviews “Yancey doesn’t hit the breaks for one moment, and the action is intense, but the language always stays lyrical and lovely. It’s a satisfying end to an impressive trilogy, true to the characters and the world Yancey created.”—Entertainment Weekly “Yancey has capped off his riveting series with a perfect ending.”—TeenReads.com “[T]he ending provides both satisfaction and heartbreak.”—Publishers Weekly “Yancey's writing is just as solid and descriptive as in the first two books….What Yancey does beautifully is reveal the human condition.”—Examiner.com \"Rick Yancey sticks the (alien) landing in the action-packed finale to his The 5th Wave invasion saga . . . . And the author gives us a major dose of girl power as well, pairing Cassie and Ringer for an uneasy alliance that provides the best moments in this fantastic series’ thought-provoking and satisfying conclusion.”—USA Today Praise for The 5th Wave Now a major motion picture starring Chloë Grace Moretz \"Remarkable, not-to-be-missed-under-any-circumstances.\"—Entertainment Weekly \"A modern sci-fi masterpiece . . .\"—USAToday.com \"Wildly entertaining . . . I couldn't turn the pages fast enough.\"—Justin Cronin, The New York Times Book Review Praise for The Infinite Sea “Heart-pounding pacing, lyrical prose and mind-bending twists . . .”—The New York Times Book Review “Impressively improves on the excellent beginning of the trilogy.”—USA Today “An epic sci-fi novel with all the romance, action, and suspense you could ever want.”—Seventeen.com Books in the series: The 5th Wave (The First Book of The 5th Wave) The Infinite Sea (The Second Book of The 5th Wave) The Last Star (The Third Book of the The 5th Wave)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DW4pBgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2016-05-24",publisher:h,subtitle:"The Final Book of The 5th Wave"}},{id:1859,attributes:{title:"The 5th Wave: Free Sample",description:"Free exclusive preview of The 5th Wave. The Passage meets The Hunger Games in this gripping new series from Carnegie-shortlisted Rick Yancey. After the 1st wave, only darkness remains. After the 2nd, only the lucky escape. And after the 3rd, only the unlucky survive. After the 4th wave, only one rule applies: trust no one. Now, it's the dawn of the 5th wave. On a lonely stretch of highway, Cassie runs from Them. The beings who only look human, who roam the countryside killing anyone they see. Who have scattered Earth's last survivors. To stay alone is to stay alive, until Cassie meets Evan Walker. Beguiling and mysterious, Evan may be her only hope for rescuing her brother and even saving herself. Now Cassie must choose: between trust and despair, between defiance and surrender, between life and death. To give up or to get up. Cassie Sullivan gets up. Begin Cassie's journey with free sample chapters from The Fifth Wave www.The5thWaveIsComing.com About the author: Rick Yancey (www.rickyancey.com) is the author of several adult novels and the memoir Confessions of a Tax Collector. His first young-adult novel, The Extraordinary Adventures of Alfred Kropp, was a finalist for the Carnegie Medal. In 2010, his novel, The Monstrumologist, received Michael L. Printz Honor, and the sequel, The Curse of the Wendigo, was a finalist for the Los Angeles Times Book Prize. Praise for The 5th Wave: 'This is DAMN and WOW territory. Quite simply, one of the best books I've read in years.' Melissa Marr, New York Times bestselling author. 'Breathtakingly fast-paced and original, The 5th Wave is a reading tsunami that grabs hold and won't let go.' Melissa De La Cruz, New York Times bestselling author of the Blue Bloods series. 'An epic sci-fi adventure about a terrifying alien invasion. You'll read it in one sitting' Bookseller 'Yancey's heartfelt, violent, paranoid epic, filled with big heroics and bigger surprises, is part War of the Worlds, part Starship Troopers, part Invasion of the Body Snatchers, and part The Stand . . . a sure thing for reviewers and readers alike.' Booklist (starred review) 'A gripping SF trilogy about an Earth decimated by an alien invasion... the question of what it means to be human is at the forefront' Publishers Weekly",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EAstAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2013-04-08",publisher:"Penguin UK",subtitle:e}},{id:1860,attributes:{title:g,description:"\"Remarkable, not-to-be-missed-under-any-circumstances.\"—Entertainment Weekly (Grade A) The Passage meets Ender's Game in an epic new series from award-winning author Rick Yancey. After the 1st wave, only darkness remains. After the 2nd, only the lucky escape. And after the 3rd, only the unlucky survive. After the 4th wave, only one rule applies: trust no one. Now, it's the dawn of the 5th wave, and on a lonely stretch of highway, Cassie runs from Them. The beings who only look human, who roam the countryside killing anyone they see. Who have scattered Earth's last survivors. To stay alone is to stay alive, Cassie believes, until she meets Evan Walker. Beguiling and mysterious, Evan Walker may be Cassie's only hope for rescuing her brother--or even saving herself. But Cassie must choose: between trust and despair, between defiance and surrender, between life and death. To give up or to get up. \"Wildly entertaining . . . I couldn't turn the pages fast enough.\"—Justin Cronin, The New York Times Book Review \"A modern sci-fi masterpiece . . . should do for aliens what Twilight did for vampires.\"—USAToday.com",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kQ5zDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2018-11-06",publisher:h,subtitle:"5th Year Anniversary"}},{id:1861,attributes:{title:"The Infinite Sea",description:"How do you rid the Earth of seven billion humans? Rid the humans of their humanity. Cassie Sullivan and her companions lived through the Others' four waves of destruction. Now, with the human race nearly exterminated and the 5th Wave rolling across the landscape, they face a choice- brace for winter and hope for Evan Walker's return, or set out in search of other survivors before the enemy closes in. Because the next attack is more than possible - it's inevitable. No one can anticipate the depths to which the Others will sink - nor the heights to which humanity will rise . . . 'Wildly entertaining . . . I couldn't turn the pages fast enough.' New York Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OThhvQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-01-01",publisher:"G.P. Putnam's Sons",subtitle:e}}]}}},meta:{}}},prerenderedAt:1688531246297}}("movie","Rick Yancey","series",null,"",1,"The 5th Wave","Penguin"))